import React, { useEffect, useState } from 'react';
import { FaUser, FaEnvelope, FaPhone, FaMapMarkerAlt } from 'react-icons/fa'; // Import icons

const Profile = () => {
    const [user, setUser] = useState(null);

    useEffect(() => {
        // Retrieve user data from localStorage
        const savedUser = localStorage.getItem('user');
        console.log('Saved user from localStorage:', savedUser);  // Debugging line

        if (savedUser) {
            setUser(JSON.parse(savedUser));  // Parse and set the user data
        }
    }, []);

    if (!user) {
        return <div className="text-center mt-5" style={{ color: 'white', fontSize: '1.2rem' }}>Loading...</div>;  // Show loading message while data is being fetched
    }

    return (
        <div 
            className="d-flex justify-content-center align-items-center"
            style={{
                minHeight: '100vh',  // Full viewport height
                background: 'linear-gradient(135deg, #4b6cb7, #182848)', 
                fontFamily: 'Arial, sans-serif',
                display: 'flex',
                flexDirection: 'column',  // Ensures content is centered vertically
                justifyContent: 'center', // Center content vertically
                alignItems: 'center', // Center content horizontally
                padding: '20px', // Ensure there's padding for better layout handling
            }}
        >
            <div 
                className="card shadow-lg p-5"
                style={{
                    maxWidth: '500px', 
                    width: '100%', 
                    borderRadius: '25px', 
                    backgroundColor: '#fff', 
                    boxShadow: '0px 10px 20px rgba(0, 0, 0, 0.1)', 
                    color: '#333',
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',  // Center the content horizontally in the card
                    textAlign: 'center',   // Center the text inside the card
                    transition: 'transform 0.3s ease-in-out', // Smooth hover effect
                }}
                onMouseEnter={(e) => e.currentTarget.style.transform = 'scale(1.05)'} // Hover effect
                onMouseLeave={(e) => e.currentTarget.style.transform = 'scale(1)'} 
            >
                <div className="mb-4">
                    <h2 style={{ color: '#4e73df', fontSize: '2rem', fontWeight: 'bold' }}>Quiz App</h2>
                    <h3 className="text-primary" style={{ fontSize: '1.5rem', fontWeight: '600' }}>User Profile</h3>
                </div>

                <div className="mb-4" style={{ width: '100%' }}>
                    <div className="d-flex justify-content-between mb-3">
                        <h4><FaUser style={{ color: '#4e73df', marginRight: '10px' }} /> <strong>Name:</strong></h4>
                        <p>{user.name}</p>
                    </div>
                    <div className="d-flex justify-content-between mb-3">
                        <h4><FaEnvelope style={{ color: '#4e73df', marginRight: '10px' }} /> <strong>Email:</strong></h4>
                        <p>{user.email}</p>
                    </div>
                    <div className="d-flex justify-content-between mb-3">
                        <h4><FaPhone style={{ color: '#4e73df', marginRight: '10px' }} /> <strong>Phone:</strong></h4>
                        <p>{user.phone}</p>
                    </div>
                    <div className="d-flex justify-content-between mb-3">
                        <h4><FaMapMarkerAlt style={{ color: '#4e73df', marginRight: '10px' }} /> <strong>Pincode:</strong></h4>
                        <p>{user.pincode}</p>
                    </div>
                </div>

                <button 
                    style={{
                        backgroundColor: '#4e73df', 
                        color: '#fff', 
                        border: 'none', 
                        borderRadius: '20px', 
                        padding: '10px 20px', 
                        fontSize: '1rem',
                        cursor: 'pointer',
                        transition: 'background-color 0.3s ease-in-out',
                    }}
                    onMouseEnter={(e) => e.currentTarget.style.backgroundColor = '#2e4a8c'} // Button hover effect
                    onMouseLeave={(e) => e.currentTarget.style.backgroundColor = '#4e73df'}
                >
                    Edit Profile
                </button>
            </div>
        </div>
    );
};

export default Profile;
